import React from 'react';
import ReactDOM from 'react-dom/client';

const contact = (proop) => {
  console.log(proop);
  const i = [];
  for (let q =0; q < proop.contacts.length; q++) i.push(proop.contacts[q].firstName)
  return 
}

export default contact;
